import { type } from './../action'

/*
* 传输初始化*/
const initialState = {
  studentID: '',
  studentPassword: '',
  studentMajor: '',
};

export default (state = initialState, action) =>{
  switch (action) {
    case type.SEND_DATA :
      return{
        ...state,
        studentID: action.studentData.studentID,
        studentPassword: action.studentData.studentPassword,
        studentMajor: action.studentData.studentMajor,
      };
    default :
      break;
  }
}
